import React from 'react'
import Typewriter from 'typewriter-effect'

const Projects = () => {
  return (
    <div><div>
      <Typewriter

       sentences={ [" Developer "," Fullstack "," Freelancer "," Player "]}
        speed={150}
         typeSpeed= {15}
    deleteSpeed={50}
    delaySpeed= {1000}
    loop
      />
    </div></div>
  )
}

export default Projects
